import React from "react";
import CategorySubPage from "../components/CategorySubPage";
import exploitImage from "../assets/image-exploit.png";

const WebExploitation = () => {
  return (
    <CategorySubPage
      title="Web Exploitation"
      description="Agent, we've identified The Phantom Collective's web infrastructure. 
      Their network is protected by a series of web applications, each hiding critical data behind layers of security. 
      Your mission is to exploit vulnerabilities in these web systems, bypass their defenses, and extract the hidden information. 
      You'll need to utilize your skills in SQL injection, cross-site scripting, and other web exploitation techniques. 
      Remember, every successful breach brings us closer to dismantling their operation. 
      The clock is ticking â€“ can you navigate their web maze and retrieve the data we need?"
      imageSrc={exploitImage}
      buttons={[
        { text: "Infiltrate Web Systems", path: "/web-exploitation/challenges" },
      ]}
    />
  );
};

export default WebExploitation;
